package com.mvc.myboard.delivery;

public class deliveryDto {
	
	private String delno;
	private String protitle;
	private int proamout;
	private int total;
	private String username;
	private String delstate;
	private String deldate;
	private String address_1;
	private String address_2;
	
	
	public deliveryDto() {
		// TODO Auto-generated constructor stub
	}


	public deliveryDto(String delno, String protitle, int proamout, int total, String username, String delstate,
			String deldate, String address_1, String address_2) {
		super();
		this.delno = delno;
		this.protitle = protitle;
		this.proamout = proamout;
		this.total = total;
		this.username = username;
		this.delstate = delstate;
		this.deldate = deldate;
		this.address_1 = address_1;
		this.address_2 = address_2;
	}


	public String getDelno() {
		return delno;
	}


	public void setDelno(String delno) {
		this.delno = delno;
	}


	public String getProtitle() {
		return protitle;
	}


	public void setProtitle(String protitle) {
		this.protitle = protitle;
	}


	public int getProamout() {
		return proamout;
	}


	public void setProamout(int proamout) {
		this.proamout = proamout;
	}


	public int getTotal() {
		return total;
	}


	public void setTotal(int total) {
		this.total = total;
	}


	public String getUsername() {
		return username;
	}


	public void setUsername(String username) {
		this.username = username;
	}


	public String getDelstate() {
		return delstate;
	}


	public void setDelstate(String delstate) {
		this.delstate = delstate;
	}


	public String getDeldate() {
		return deldate;
	}


	public void setDeldate(String deldate) {
		this.deldate = deldate;
	}


	public String getAddress_1() {
		return address_1;
	}


	public void setAddress_1(String address_1) {
		this.address_1 = address_1;
	}


	public String getAddress_2() {
		return address_2;
	}


	public void setAddress_2(String address_2) {
		this.address_2 = address_2;
	}


	@Override
	public String toString() {
		return "deliveryDto [delno=" + delno + ", protitle=" + protitle + ", proamout=" + proamout + ", total=" + total
				+ ", username=" + username + ", delstate=" + delstate + ", deldate=" + deldate + ", address_1="
				+ address_1 + ", address_2=" + address_2 + "]";
	}
	
	
	
}
